export function getUnit(level, index) {

    switch (index) {
        case 1:
            return require("../data/unit/level1").unit1       
        case 2:
            return require("../data/unit/level1").unit2       
        case 3:
            return require("../data/unit/level1").unit3       
        default:
            break;
    }


}
